![medium](https://www.gstatic.com/codereviewagent/medium-priority.svg)

This line adds `backface-visibility` properties that are also present on the parent `.face` element (line 26). This duplication can make the CSS harder to maintain. If these properties need to be changed in the future, they would need to be updated in two places, which is error-prone. Consider refactoring to a single rule to keep the code DRY (Don't Repeat Yourself), for example:

```css
.face, .face img { 
  backface-visibility: hidden; 
  -webkit-backface-visibility: hidden; 
}
```

This would involve removing the `backface-visibility` properties from the individual `.face` and `.face img` rules.

